import React from "react"
import Konva from "konva"
import { Circle } from "react-konva";

export default class Loop extends React.Component{
    render(){
        return (
            <Circle
                x={window.innerWidth/2}
                y={window.innerHeight/2}
                radius={window.innerHeight/3}
                fill={'none'} 
                stroke={'black'}
                strokeWidth={5}
            />
        )
    }
}
